{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/amirmotefaker/sentiment-analysis-model-using-r?scriptVersionId=150250418\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"980e6c94","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","papermill":{"duration":0.009672,"end_time":"2023-11-11T11:06:46.744547","exception":false,"start_time":"2023-11-11T11:06:46.734875","status":"completed"},"tags":[]},"source":["# What is Sentiment Analysis?\n","- Sentiment analysis is the process of analyzing digital text to determine if the emotional tone of the message is positive, negative, or neutral. Today, companies have large volumes of text data like emails, customer support chat transcripts, social media comments, and reviews. Sentiment analysis tools can scan this text to automatically determine the author’s attitude towards a topic. Companies use the insights from sentiment analysis to improve customer service and increase brand reputation. \n","# Why is sentiment analysis important?\n"," - Provide objective insights\n"," - Build better products and services\n"," - Analyze at scale\n"," - Real-time results\n"," \n","# What are sentiment analysis use cases?\n","  - Improve customer service\n","  - Brand monitoring\n","  - Market research\n","  - Track campaign performance\n","  \n","# What are the different types of sentiment analysis?\n"," - Fine-grained scoring\n"," - Aspect-based\n"," - Intent-based\n"," - Emotional detection\n"," \n","\n","##### Reference : [Amazon](https://aws.amazon.com/what-is/sentiment-analysis/)\n","\n","\n","# Sentiment Analysis Model:\n","- We will carry out sentiment analysis with R in this project. The dataset that we will use will be provided by the R package ‘janeaustenR’.\n","\n","## janeaustenr: Jane Austen's Complete Novels:\n","- Full texts for Jane Austen's 6 completed novels, ready for text analysis. These novels are \"Sense and Sensibility\", \"Pride and Prejudice\", \"Mansfield Park\", \"Emma\", \"Northanger Abbey\", and \"Persuasion\". [janeaustenr](https://cran.r-project.org/web/packages/janeaustenr/index.html)\n","\n","\n","- In order to build our project on sentiment analysis, we will make use of the tidytext package that comprises sentiment lexicons that are present in the dataset of ‘sentiments’."]},{"cell_type":"markdown","id":"b5e5809d","metadata":{"papermill":{"duration":0.008285,"end_time":"2023-11-11T11:06:46.761199","exception":false,"start_time":"2023-11-11T11:06:46.752914","status":"completed"},"tags":[]},"source":["# Install Libraries"]},{"cell_type":"code","execution_count":1,"id":"c69e4d94","metadata":{"execution":{"iopub.execute_input":"2023-11-11T11:06:46.783022Z","iopub.status.busy":"2023-11-11T11:06:46.780186Z","iopub.status.idle":"2023-11-11T11:07:20.916388Z","shell.execute_reply":"2023-11-11T11:07:20.914239Z"},"papermill":{"duration":34.149814,"end_time":"2023-11-11T11:07:20.919222","exception":false,"start_time":"2023-11-11T11:06:46.769408","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n"]}],"source":["install.packages(\"janeaustenr\")\n","install.packages(\"tidytext\")"]},{"cell_type":"markdown","id":"07702a35","metadata":{"papermill":{"duration":0.008703,"end_time":"2023-11-11T11:07:20.937312","exception":false,"start_time":"2023-11-11T11:07:20.928609","status":"completed"},"tags":[]},"source":["# Import Libraries"]},{"cell_type":"code","execution_count":2,"id":"32c6930c","metadata":{"execution":{"iopub.execute_input":"2023-11-11T11:07:20.991603Z","iopub.status.busy":"2023-11-11T11:07:20.957205Z","iopub.status.idle":"2023-11-11T11:07:22.