143X)"]},{"cell_type":"markdown","id":"823343f0","metadata":{"papermill":{"duration":0.009091,"end_time":"2023-11-11T11:07:22.503279","exception":false,"start_time":"2023-11-11T11:07:22.494188","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"5bc1d9e9","metadata":{"papermill":{"duration":0.009148,"end_time":"2023-11-11T11:07:22.522407","exception":false,"start_time":"2023-11-11T11:07:22.513259","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"c0bc5826","metadata":{"execution":{"iopub.execute_input":"2023-11-11T11:07:22.545624Z","iopub.status.busy":"2023-11-11T11:07:22.543412Z","iopub.status.idle":"2023-11-11T11:07:22.622318Z","shell.execute_reply":"2023-11-11T11:07:22.61963Z"},"papermill":{"duration":0.093499,"end_time":"2023-11-11T11:07:22.625406","exception":false,"start_time":"2023-11-11T11:07:22.531907","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>positive</td></tr>\n","\t<tr><td>